import Navbar from "components/Navbar";
import "pages/indexmatty.jpg";

const Index = () => {
  return (
    <>
      <style jsx global>{`
        body {
          background-image: url("./public/indexmatty.jpg");
        }
      `}</style>
      <div className="index"></div>
    </>
  );
};

export default Index;
